import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/threecolumns", {
  title: __("Three Columns", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUB: { type: "string", default: `Frequently asked questions` },
    contentUA: {
      type: "string",
      default: `What&#039;s the best thing about Switzerland?`,
    },
    contentt: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <h2 className="text-3xl font-extrabold text-gray-900 text-center">
            <RichText
              value={attributes.contentUB}
              default={"Frequently asked questions"}
              onChange={(newtext) => setAttributes({ contentUB: newtext })}
            />
          </h2>
          <div className="mt-12">
            
            <dl className="space-y-10 md:space-y-0 md:grid md:grid-cols-2 md:gap-x-8 md:gap-y-12 lg:grid-cols-3">
              
            {arData.map((v) => {
              return (
                <div>
                
                <dt className="text-lg leading-6 font-medium text-gray-900">
                  {v.question}
                </dt>
                <dd className="mt-2 text-base text-gray-500">
                  {v.answer}
                </dd>
              </div>
              )
            })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:px-8">
          
          <h2 class="text-3xl font-extrabold text-gray-900 text-center">
           <RichText.Content value={attributes.contentUB}/>
          </h2>
          <div class="mt-12">
            
            <dl class="space-y-10 md:space-y-0 md:grid md:grid-cols-2 md:gap-x-8 md:gap-y-12 lg:grid-cols-3">
              
            {arData.map((v) => {
              return (
                <div>
                  <dt class="text-lg leading-6 font-medium text-gray-900">
                    {v.question}
                  </dt>
                  <dd class="mt-2 text-base text-gray-500">
                    {v.answer}
                  </dd>
                </div>
              )
            })}
            </dl>
          </div>
        </div>
      </div>
    );
  },
});
